const NavBar = () => {
    return(
        <div className="bg-gray-700">
        <div className="h-screen w-48 pt-3 px-2 bg-gray-900">
          <ul className="duration-300 flex flex-col gap-3 text-xl font-medium  text-gray-50">
              <li className="transition ease-out inline-block p-2 rounded-lg hover:text-orange-600 hover:bg-gray-800 hover:cursor-pointer">Início</li>
              <li className="transition ease-out inline-block p-2 rounded-lg hover:text-orange-600 hover:bg-gray-800 hover:cursor-pointer">Receitas</li>
              <li className="transition ease-out inline-block p-2 rounded-lg hover:text-orange-600 hover:bg-gray-800 hover:cursor-pointer">Planos diários</li>
              <li className="transition ease-out duration-300 inline-block p-2 rounded-lg hover:text-orange-600 hover:bg-gray-800 hover:cursor-pointer">Configurações</li>
          </ul>  
        </div>
        </div>
    )

}

export default NavBar;
